using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;

namespace ConsoleApplication
{
    public class Program
    {
        public static void Main(string[] args)
        {
            PartOne();
            PartTwo();
        }

        private static void PartOne()
        {
            string input = @"



";
            string result = "";
            int[,] numpad = new int[3, 3] { { 1, 2, 3 }, { 4, 5, 6 }, { 7, 8, 9 } };
            int[] current = new int[2] { 1, 1 };

            using (var sr = new StringReader(input))
            {
                string line;
                while ((line = sr.ReadLine()) != null)
                {
                    var linelist = line.ToCharArray();

                    foreach (var ch in linelist)
                    {
                        switch (ch)
                        {
                            case 'U':
                                if (current[1] > 0)
                                    current[1]--;
                                break;
                            case 'D':
                                if (current[1] < 2)
                                    current[1]++;
                                break;
                            case 'L':
                                if (current[0] > 0)
                                    current[0]--;
                                break;
                            case 'R':
                                if (current[0] < 2)
                                    current[0]++;
                                break;
                        }
                    }

                    result += numpad[current[1], current[0]];
                }
            }

            Console.WriteLine(result);
        }

        public static void PartTwo()
        {
            string input = @"



";
            string result = "";
            char[,] numpad = new char[5, 5] { { '0', '0', '1', '0', '0' }, {'0', '2', '3', '4', '0'}, {'5', '6', '7', '8', '9'}, {'0', 'A', 'B', 'C', '0'}, {'0', '0', 'D', '0', '0'} };
            int[] current = new int[2] { 0, 2 };

            using (var sr = new StringReader(input))
            {
                string line;
                while ((line = sr.ReadLine()) != null)
                {
                    var linelist = line.ToCharArray();

                    foreach (var ch in linelist)
                    {
                        switch (ch)
                        {
                            case 'U':
                                if (current[1] > 0)
                                {
                                    if (numpad[current[1]-1, current[0]] != '0')
                                        current[1]--;
                                }
                                break;
                            case 'D':
                                if (current[1] < 4)
                                {
                                    if (numpad[current[1]+1, current[0]] != '0')
                                        current[1]++;
                                }
                                break;
                            case 'L':
                                if (current[0] > 0)
                                {
                                    if (numpad[current[1], current[0]-1] != '0')
                                        current[0]--;
                                }
                                break;
                            case 'R':
                                if (current[0] < 4)
                                {
                                    if (numpad[current[1], current[0]+1] != '0')
                                        current[0]++;
                                }
                                break;
                        }
                    }

                    result += numpad[current[1], current[0]];
                }
            }
            Console.WriteLine(result);
        }
    }
}
